DROP TABLE IF EXISTS customers;
CREATE TABLE IF NOT EXISTS customers(
   id                 INTEGER  NOT NULL PRIMARY KEY
  ,name               VARCHAR(55) NOT NULL
  ,date_opening       VARCHAR(55) NOT NULL
  ,city               VARCHAR(55) NOT NULL
  ,region             VARCHAR(55) NOT NULL
  ,country            VARCHAR(55) NOT NULL
  ,postalZip          VARCHAR(55) NOT NULL
  ,phone              VARCHAR(55) NOT NULL
  ,email              VARCHAR(55) NOT NULL
  ,amount             VARCHAR(12) NOT NULL
  ,coordonates        VARCHAR(55) NOT NULL
  ,iban               VARCHAR(55) NOT NULL
  ,pan                VARCHAR(55) NOT NULL
  ,cvv                INTEGER  NOT NULL
  ,date_of_expiration VARCHAR(5) NOT NULL
  ,pin                INTEGER  NOT NULL
);
